interface IMatchProps {
    startDate: string;
    technology: (keyof typeof technologies)[];
    CompanyLogo: () => React.JSX.Element;
    company: string;
    title: string;
    endDate?: string | Date;
    projects?: string[];
}

function Match({ startDate, technology, title, CompanyLogo, company, endDate = new Date(), projects }: IMatchProps) {
    const today = new Date(endDate)
    const start = new Date(startDate)
    return (
        <article className={`grid lg:grid-cols-7 md:grid-cols-3 grid-cols-2 gap-y-5 p-2 ${beaufort.className} hover:border-l-10 hover:border-gold-5`}>
            <div className="relative logo-circle" title={company}>
                <CompanyLogo />
                <div className="absolute -bottom-1 right-0 level-circle">
                    <h2 className={`text-gold-1`} title="Years">{today.getFullYear() - start.getFullYear()}</h2>
                </div>
            </div>
            <div>
                <h3 className="text-2xl uppercase text-blue-2">{company.toUpperCase()}</h3>
                <h4 className={`text-gold-1 text-lg ${spiegel.className}`}>{title}</h4>
                <div className="flex">
                    <TSLogo />
                    <JSLogo />
                </div>
            </div>
            <div className="lg:col-span-3 sm:col-span-2 md:col-span-1 space-y-4">
                <div className="flex flex-row justify-center px-3">
                    {technology.map((t,i) => {
                        const Component = technologies[t];
                        return <Component key={i} />
                    })}
                </div>
                <div className="flex justify-center items-end text-center text-gold-1">
                    <p>
                        {projects?.join(", ")}
                    </p>
                </div>
            </div>
            <div className="flex flex-col">
                <h4 className={`text-gold-1 text-xl ${spiegel.className}`}>{title}</h4>
                <section className="py-4">
                    <p className={`text-gold-1 text-lg ${spiegel.className}`}>{start.toLocaleDateString()} - {today.toLocaleDateString()}</p>
                </section>
            </div>
            <div className="md:col-span-2 lg:col-span-1 justify-self-end">
                <section className="rounded-4xl bg-grey-5 h-15 w-15 border-3 pt-[5] pl-[7] border-gold-4 box-shadow-xs box-shadow-gold-4">
                    <Link href={`/resume/${company.toLowerCase()}`} title="More stats">
                        <DownloadIcon />
                    </Link>
                </section>
            </div>
        </article>);
};

